// src/components/Header.js
import React from 'react';

function Header() {
  return (
    <nav className="navbar navbar-dark bg-dark">
      <div className="container">
        <a className="navbar-brand" href="/">My Awesome Portfolio</a>
      </div>
    </nav>
  );
}

export default Header;
